import React from 'react';
import './App.css';

function GameBoard() {
  return (
    <div className="Gameboard">
      <header className="gameboard-header">
        <p></p>
        <img src="game_board_copy.png" />
        <p></p>
      </header>
    </div>
  );
}

export default GameBoard;
